--
-- Cấu trúc cho view `v_daily_revenue_summary`
--
DROP TABLE IF EXISTS `v_daily_revenue_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_daily_revenue_summary`  AS SELECT `pm_nc0009`.`lv029` AS `ngay`, count(0) AS `tong_luot`, sum(`pm_nc0009`.`lv013`) AS `doanh_thu`, avg(`pm_nc0009`.`lv013`) AS `gia_trung_binh`, count(distinct `pm_nc0009`.`lv003`) AS `so_xe_khac_nhau`, sum(case when `pm_nc0009`.`lv020` = 'TIEN_MAT' then `pm_nc0009`.`lv013` else 0 end) AS `tien_mat`, sum(case when `pm_nc0009`.`lv020` = 'QR_CODE' then `pm_nc0009`.`lv013` else 0 end) AS `qr_code`, sum(case when `pm_nc0009`.`lv020` = 'THE' then `pm_nc0009`.`lv013` else 0 end) AS `the_rfid` FROM `pm_nc0009` WHERE `pm_nc0009`.`lv014` = 'DA_RA' GROUP BY `pm_nc0009`.`lv029` ORDER BY `pm_nc0009`.`lv029` DESC ;

-- --------------------------------------------------------

--
-- Cấu trúc cho view `v_hourly_traffic_summary`
--
DROP TABLE IF EXISTS `v_hourly_traffic_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_hourly_traffic_summary`  AS SELECT `pm_nc0009`.`lv029` AS `ngay`, `pm_nc0009`.`lv030` AS `gio`, count(0) AS `tong_luot`, sum(`pm_nc0009`.`lv014` in ('VAO','DANG_GUI')) AS `xe_vao`, sum(`pm_nc0009`.`lv014` = 'DA_RA') AS `xe_ra`, sum(`pm_nc0009`.`lv013`) AS `doanh_thu_gio` FROM `pm_nc0009` GROUP BY `pm_nc0009`.`lv029`, `pm_nc0009`.`lv030` ORDER BY `pm_nc0009`.`lv029` DESC, `pm_nc0009`.`lv030` ASC ;

